import { Link } from 'react-router-dom';

const ProductsPage = () => {
  return <>
  <div>
    <ul>
      <li>Product 1</li>
      <li>Product 2</li>
      <li>Product 3</li>
      <li>Product 4</li>
      <li>Product 5</li>
    </ul>
  </div>
  <Link href="/">Go back to the Hoem page</Link>
  </>
};

export default ProductsPage;
